        name: DataTypes.STRING,
        image: DataTypes.TEXT,
        contentHTML: DataTypes.TEXT('long'),
        contentMarkdown: DataTypes.TEXT('long'),
        userId: DataTypes.INTEGER,
    }, {
        sequelize,
        modelName: 'Handbook',
    });
    return Handbook;
};

